  return (
    <div className="footer-container">
      <a href="https://github.com/DeanLeong"><h3>GitHub</h3></a>
      <a href="https://www.linkedin.com/in/dean-leong-2a68041b2/" target="_blank"><h3>LinkedIn</h3></a>
    </div>
  );
}

export default Footer;
